import Link from 'next/link';


const Navbar = () => (
<div>
    <div className="container">
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href="/about">
            <a>About</a>
        </Link>
    </div>   
    <style jsx>{`
        a {
            color: red;
        }

        div {
            background: blue;
        }
    `} </style>
</div>

);
  
  export default Navbar;
